import React, { Component } from "react";
import axios from "axios";
import "./Myquater.css"



class Myquater extends Component {
    constructor(props) {
        super(props);
        this.state = {
            listquaters: [],
            userhavequater: false
        }




    }
    componentDidMount = () => {
        var { listquaters } = this.state;
        axios.get(this.props.store.backendadress + '/ovnerrip/getdataovnerripburial', { params: { ovnerripid: this.props.email } })
            .then(res => {
                //console.log(res.data);
                //console.log(typeof res.data);
                //console.log(res.data[0]);
                //console.log(Object.keys(res.data).length);
                if (Object.keys(res.data).length > 0) {
                    for (var i = 0; i < Object.keys(res.data).length; i++) {
                         console.log(res.data[i]);
                        listquaters.push(
                            <div className="rowquater"key={i}>
                            <div key={i+"a"}>{res.data[i].IdGraveQuaters}</div>
                            <div key={i+"b"}>{res.data[i].TypeOF}</div>
                            <div key={i+"c"}>{res.data[i].DatePayment.slice(0,10).split("-").reverse().join("-")}</div>
                            <div key={i+"d"}>{res.data[i].NumberTraditionalBurials}</div>
                            <div key={i+"e"}>{res.data[i].NumberenableTraditionalBurials-res.data[i].NumberTraditionalBurials}</div>
                            <div key={i+"f"}>{res.data[i].NumberUrnBurials}</div>
                            <div key={i+"g"}>{res.data[i].NumberenableUrnBurials-res.data[i].NumberUrnBurials}</div>
                        </div>
                        )
                    }
                    this.setState({ userhavequater: true });
                }





            })
    }


    render() {
        const { userhavequater, listquaters } = this.state

        return (
            <div key={201}>
                {userhavequater ?

                    [ <div key={210}>Twoje kwatery</div>,
                    <div key={211}>
                        <div className="rowquater" key={212}>
                            <div key={213}>Numer Kwatery</div>
                            <div key={214}>Typ grobu</div>
                            <div key={215}>Opłacony do</div>
                            <div key={216}> Wykorzystane pochówki tradycyjne</div>
                            <div key={217}> Pozostałe pochówki tradycyjne</div>
                            <div key={218}> Wykorzystane pochówki urnowe</div>
                            <div key={219}> Pozostałe pochówki urnowe</div>
                        </div>
                        {listquaters}</div>,                     
                    ] : [
                        <div key={202}>Nie posiadasz kwater przypisanych do swojego konta</div>
                    ]}


            </div>
        )


    }

}

export default Myquater
